using Mi9CodingChallenge.Tests.TestData;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using System.Net;
using System.Net.Http;
using System.Web.Http;
using System.Web.Http.Hosting;

namespace Mi9CodingChallenge.Tests.Controllers
{
    [TestClass]
    public class PayloadControllerTest
    {
        private static void SetupControllerForTests(ApiController controller)
        {
            controller.ControllerContext = new System.Web.Http.Controllers.HttpControllerContext();
            controller.ControllerContext.Request = new HttpRequestMessage();
            controller.ControllerContext.Configuration  = new HttpConfiguration();
            controller.ControllerContext.Request.Properties.Add(HttpPropertyKeys.HttpConfigurationKey, controller.ControllerContext.Configuration);
        }

        [TestMethod]
        public void MustReturnValidReponse()
        {
            //Arrange
            var controller = new PayloadController();
            var request = PayloadMother.GetPayloadRequest();
            SetupControllerForTests(controller);

            // Act
            HttpResponseMessage response = controller.Post(request);

            // Assert
            Assert.IsNotNull(response);
            Assert.IsNotNull(response.Content);
            Assert.AreEqual(HttpStatusCode.OK, response.StatusCode);

            var content = (((ObjectContent)(response.Content)).Value);

            Assert.IsNotNull(content);
        }
    }
}

