using System.Linq;
using System.Net;
using System.Net.Http;
using System.Web.Http;

namespace Mi9CodingChallenge
{
    public class PayloadController : ApiController
    {
        /// <summary>
        /// API call to parse payloadrequest, returning a filtered response containing
        /// only the ones with DRM enabled and episodecount greater than 0
        /// </summary>
        /// <postdata>
        /// e.g https://github.com/mi9/coding-challenge-samples/blob/master/sample_request.json
        /// </postdata>
        /// <returns>{
        /// e.g https://github.com/mi9/coding-challenge-samples/blob/master/sample_response.json
        ///</returns>
        /// <example>
        /// http://mi9codingchallenge.apphb.com/
        /// </example>
        /// <exception>400 - BadRequest - if invalid json is parsed</exception>
        [HttpPost]
        public HttpResponseMessage Post(PayloadRequest request)
        {
            if (request != null && ModelState.IsValid)
            {
                var result = request.Payload.Where(p => p.Drm && p.EpisodeCount > 0)
                            .Select(p => new PayloadResponse
                            {
                                Image = p.Image.ShowImage,
                                Slug = p.Slug,
                                Title = p.Title
                            });

                return ControllerContext.Request.CreateResponse(HttpStatusCode.OK,new {response = result});
            }
            else
            {
                return ControllerContext.Request.CreateResponse(HttpStatusCode.BadRequest, new { error = "Could not decode request: JSON parsing failed" });
            }
        }
    }
